import React, { useEffect, useState } from "react";
import "./formpost.css";
const Formpost = () => {
  return (
    <div>
        <Form>
  <Form.Row>
    <Col xs={7}>
      <Form.Control placeholder="City" />
    </Col>
    <Col>
      <Form.Control placeholder="State" />
    </Col>
    <Col>
      <Form.Control placeholder="Zip" />
    </Col>
  </Form.Row>
</Form>
    </div>
  );
};

export default Formpost;
